import { jsTPS_Transaction } from '../common/jsTPS';

export default class MoveItemUp_Transaction extends jsTPS_Transaction {
    constructor(initApp, id) {
        super()
        this.app = initApp;
        this.id = id;
    }
    doTransaction() {
        this.app.MoveItemUp_Transaction(this.value, this.id);
    }
    undoTransaction() {
        this.app.handleDueDateChange(this.prevValue, this.id);
    }
}
